/**
 * Abstract base class for transports that implements common functionality
 */
export class AbstractTransport {
    _onclose;
    _onerror;
    _onmessage;
    set onclose(handler) {
        this._onclose = handler;
    }
    set onerror(handler) {
        this._onerror = handler;
    }
    set onmessage(handler) {
        this._onmessage = handler;
    }
}
